function NavBar(){
    return(
        <nav>
            <div className="logo">
                <h1>TYLER</h1>
            </div>
            <ul className="nav-items">
                    <li><a href="">HOME</a></li>
                    <li><a href="">ABOUT</a></li>
                    <li><a href="">PROJECTS</a></li>
                </ul>
        </nav>
    )
}
export default NavBar;
